  name: 'Batch 001',
  quantity: 100
})

// Serial numbers for variants/batches
const variantSerials = await variant.getSN('collection-id', 'product-id', 'variant-id')
const batchSerials = await batch.getSN('collection-id', 'product-id', 'batch-id')
